import React from "react";

function Addnote() {
    return (
        <div className="Title">
        <form>
            <input type="title" name=" Title" placeholder="Title"></input>
            <p><textarea name=" Note" placeholder="Take a note..."></textarea></p>
            <button type="submit">Add</button>
        </form>
    </div>
    );
}
export default Addnote;
